def search(arr, n):
    left, right = 0, n - 1

    while left < right:
        mid = left + (right - left) // 2

        # Check if mid is even or odd
        if mid % 2 == 0:
            if arr[mid] == arr[mid + 1]:
                left = mid + 2
            else:
                right = mid
        else:
