        return triangle[0][0]

    for r in range(row + 1):
        for c in range(r + 1):
            if r == 0 and c == 0:
                continue
            left_parent = triangle[r - 1][c - 1] if c > 0 else 0
            right_parent = triangle[r - 1][c] if c < r else 0
            triangle[r][c] += max(left_parent, right_parent)

    return triangle[row][col]

