        result.extend([i for i in row if i == element])
    return result

def tuple_int_str(string_tuple):
    result = tuple(int(value) for value in string_tuple)
    return result

def encode_list(lst):
    if not lst:
        return []

    encoded = []
    count = 1
    current = lst[0]

    for i in range(1, len(lst)):
        if lst[i] == current:
            count += 1
        else:
            encoded.append((count, current))
            current = lst[i]
            count = 1

    encoded.append((count, current))

    return encoded

def min_Ops(arr, n, k):
    max_elem = max(arr)
    operations = 0

    for num in arr:
        operations += (max_elem - num) // k
        if (max_elem - num) % k != 0:
            operations += 1

    return operations

def month_season(month, day):
    seasons = {
        'Winter': [(12, 21), (3, 19)],
        'Spring': [(3, 20), (6, 20)],
        'Summer': [(6, 21), (9, 22)],
        'Fall': [(9, 23), (12, 20)]
    }

    month_days = {
        'January': 1, 'February': 2, 'March': 3, 'April': 4,
        'May': 5, 'June': 6, 'July': 7, 'August': 8,
        'September': 9, 'October': 10, 'November': 11, 'December': 12
    }

    month_num = month_days[month]

    for season, (start, end) in seasons.items():
        if (month_num == start[0] and day >= start[1]) or (month_num == end[0] and day <= end[1]):
            return season
        elif start[0] < month_num < end[0]:
            return season

    return 'Invalid date'

def solution(a, b, n):
    for x in range(n // a + 1):
        for y in range(n // b + 1):
            if a * x + b * y == n:
                return (x, y)
    return None

def remove_elements(list1, list2):
