    return result

def sum_series(n):
    result = 0
    while n > 0:
        result += n
        n -= 2
    return result

def area_polygon(sides, length):
    import math
    if sides < 3:
        return 0
    area = (sides * length**2) / (4 * math.tan(math.pi / sides))
    return area

def areEquivalent(num1, num2):
    def sum_of_divisors(n):
        total = 0
        for i in range(1, n + 1):
            if n % i == 0:
                total += i
        return total

    return sum_of_divisors(num1) == sum_of_divisors(num2)

def count_char_position(s):
    count = 0
    for i, char in enumerate(s):
        if char.lower() == chr(97 + i):  # 97 is the ASCII value for 'a'
            count += 1
    return count

def find_even_Pair(arr, n):
    count = 0
    for i in range(n):
        for j in range(i + 1, n):
            if (arr[i] ^ arr[j]) % 2 == 0:
                count += 1
    return count

def next_Power_Of_2(n):
    if n <= 0:
        return 1
    power = 1
    while power < n:
        power *= 2
    return power

def frequency(arr, num):
    count = 0
    for element in arr:
        if element == num:
            count += 1
    return count

def get_pell(n):
    if n < 0:
        return None
    elif n == 0:
        return 0
    elif n == 1:
        return 1
    else:
        a, b = 0, 1
        for _ in range(2, n + 1):
            a, b = b, 2 * b + a
        return b

def sum_range_list(lst, start, end):
