def group_keyvalue(pairs):
    result = {}
    for key, value in pairs:
        if key not in result:
            result[key] = []
        result[key].append(value)
    return result

def is_valid_parenthese(s):
    stack = []
    for char in s:
        if char == '(':
            stack.append(char)
        elif char == ')':
            if not stack:
                return False
            stack.pop()
    return len(stack) == 0

def perimeter_triangle(a, b, c):
    result = a + b + c
    return result

def answer(start, end):
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return abs(a * b) // gcd(a, b)

    for i in range(start, end + 1):
        for j in range(i + 1, end + 1):
            if start <= lcm(i, j) <= end:
                return (i, j)

    return None

def string_literals(literals, text):
    result = []
    for literal in literals:
        if literal in text:
            result.append(literal)
    return result

def is_num_keith(n):
    if n < 1:
        return False

    digits = [int(d) for d in str(n)]
    length = len(digits)

    sequence = digits[:]

    while True:
        next_term = sum(sequence)
        if next_term == n:
            return True
        elif next_term > n:
            return False
        sequence.append(next_term)
        sequence.pop(0)

def common_prefix(strings, n):
    if n == 0:
        return ""

    prefix = strings[0]

    for i in range(1, n):
        while strings[i].find(prefix) != 0:
            prefix = prefix[:-1]
            if prefix == "":
                return ""

    return prefix

def count_pairs(arr, n, k):
    seen = set()
    pairs = set()

    for number in arr:
        if (number - k) in seen:
            pairs.add((number - k, number))
        if (number + k) in seen:
            pairs.add((number, number + k))
        seen.add(number)

    return len(pairs)

def greater_specificnum(lst, num):
