    return result

def parabola_focus(h, k, p):
    focus_x = h
    focus_y = k + p
    return (focus_x, focus_y)

def longest_common_subsequence(seq1, seq2, m, n):
    L = [[0] * (n + 1) for i in range(m + 1)]

    for i in range(m + 1):
        for j in range(n + 1):
            if i == 0 or j == 0:
                L[i][j] = 0
            elif seq1[i - 1] == seq2[j - 1]:
                L[i][j] = L[i - 1][j - 1] + 1
            else:
                L[i][j] = max(L[i - 1][j], L[i][j - 1])

    index = L[m][n]
    lcs = [''] * (index + 1)
    lcs[index] = ''

    i = m
    j = n
    while i > 0 and j > 0:
        if seq1[i - 1] == seq2[j - 1]:
            lcs[index - 1] = seq1[i - 1]
            i -= 1
            j -= 1
            index -= 1
        elif L[i - 1][j] > L[i][j - 1]:
            i -= 1
        else:
            j -= 1

    return ''.join(lcs)

def prod_Square(n):
    if n < 0:
        return False
    if n == 0:
        return True
    for i in range(int(n**0.5) + 1):
        j = (n - i**2)**0.5
        if j.is_integer():
            return True
    return False

def first_Missing_Positive(nums, n):
    nums = [num for num in nums if num > 0]
    nums_set = set(nums)

    for i in range(1, n + 1):
        if i not in nums_set:
            return i

    return n + 1

def count_Intgral_Points(x1, y1, x2, y2):
    if x1 > x2 or y1 > y2:
