def inversion_elements(tuples_list):
    inversions = []
    for i in range(len(tuples_list)):
        for j in range(i + 1, len(tuples_list)):
            if tuples_list[i] > tuples_list[j]:
                inversions.append((tuples_list[i], tuples_list[j]))
    return inversions

def concatenate_elements(tuples_list):
    result = []
    for tup in tuples_list:
        concatenated = ''.join(str(tup[i]) + str(tup[i + 1]) for i in range(len(tup) - 1))
        result.append(concatenated)
    return result

def find_longest_repeating_subseq(s):
    n = len(s)
    dp = [[0] * (n + 1) for _ in range(n + 1)]

    for i in range(1, n + 1):
        for j in range(1, n + 1):
            if s[i - 1] == s[j - 1] and i != j:
                dp[i][j] = dp[i - 1][j - 1] + 1
            else:
                dp[i][j] = max(dp[i - 1][j], dp[i][j - 1])

    return dp[n][n]
